import React from 'react'

const Rating = ({value, text}) => {
  return (
    <div className='rating'>
        <span>
            <i className={
                value >= 1 
                ? `fa-light fa-star` 
                : value >= 0.5 
                ? `fa-regular fa-star-half` 
                : `fa-light fa-star`
                }/>
        </span>
    </div>
  )
}

export default Rating
